DROP TABLE IF EXISTS `daftar_tagihan_kontainer_sewa`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `daftar_tagihan_kontainer_sewa` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `vendor` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nomor_kontainer` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `size` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `tanggal_awal` date DEFAULT NULL,
  `tanggal_akhir` date DEFAULT NULL,
  `group` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `masa` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `tarif` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `tarif_nominal` decimal(15,2) DEFAULT NULL,
  `dpp` decimal(15,2) DEFAULT NULL,
  `adjustment` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT 'Penyesuaian harga DPP (bisa positif atau negatif)',
  `adjustment_note` text COLLATE utf8mb4_unicode_ci COMMENT 'Alasan atau catatan untuk adjustment',
  `invoice_vendor` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Nomor invoice dari vendor',
  `tanggal_vendor` date DEFAULT NULL COMMENT 'Tanggal invoice vendor',
  `dpp_nilai_lain` decimal(15,2) DEFAULT NULL,
  `ppn` decimal(15,2) DEFAULT NULL,
  `pph` decimal(15,2) DEFAULT NULL,
  `grand_total` decimal(18,2) DEFAULT NULL,
  `status` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status_pranota` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `pranota_id` bigint unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `periode` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `daftar_tagihan_kontainer_sewa_vendor_index` (`vendor`),
  KEY `daftar_tagihan_kontainer_sewa_nomor_kontainer_index` (`nomor_kontainer`),
  KEY `daftar_tagihan_kontainer_sewa_status_pranota_pranota_id_index` (`status_pranota`,`pranota_id`),
  KEY `idx_vendor` (`vendor`),
  KEY `idx_nomor_kontainer` (`nomor_kontainer`),
  KEY `idx_size` (`size`),
  KEY `idx_periode` (`periode`),
  KEY `idx_group` (`group`),
  KEY `idx_status_pranota` (`status_pranota`),
  KEY `idx_tanggal_awal` (`tanggal_awal`),
  KEY `idx_tanggal_akhir` (`tanggal_akhir`),
  KEY `idx_vendor_kontainer` (`vendor`,`nomor_kontainer`),
  KEY `idx_kontainer_periode` (`nomor_kontainer`,`periode`),
  KEY `idx_vendor_periode` (`vendor`,`periode`),
  KEY `idx_group_periode` (`group`,`periode`)
) ENGINE=InnoDB AUTO_INCREMENT=11461 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
