DROP TABLE IF EXISTS `master_kapals`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `master_kapals` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `kode` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Kode unik kapal',
  `kode_kapal` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Kode alternatif kapal',
  `nama_kapal` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Nama kapal',
  `nickname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `catatan` text COLLATE utf8mb4_unicode_ci COMMENT 'Catatan tambahan',
  `pelayaran` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Lokasi kapal',
  `kapasitas_kontainer_palka` int DEFAULT NULL COMMENT 'Kapasitas kontainer di palka kapal',
  `kapasitas_kontainer_deck` int DEFAULT NULL COMMENT 'Kapasitas kontainer di deck kapal',
  `gross_tonnage` decimal(12,2) DEFAULT NULL COMMENT 'Gross tonnage kapal dalam ton',
  `status` enum('aktif','nonaktif') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'aktif' COMMENT 'Status kapal',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `master_kapals_kode_unique` (`kode`),
  KEY `master_kapals_kode_index` (`kode`),
  KEY `master_kapals_status_index` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
