  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `perbaikan_kontainers_created_by_foreign` (`created_by`),
  KEY `perbaikan_kontainers_updated_by_foreign` (`updated_by`),
  KEY `perbaikan_kontainers_kontainer_id_status_perbaikan_index` (`status_perbaikan`),
